import './App.css';

function App() {
  return (
    <div className="App">
      <input type='text' placeholder='Full Name...'/>
      <input type='text' placeholder='Email...'/>
      <input type='text' placeholder='Age...'/>
      <input type='password' placeholder='Password...'/>
      <input type='password' placeholder='Confirm Password...'/>
      <input type='submit' />
    </div>
  );
}


export default App;
